import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Navbar.js";
import Footer from "./Footer.js";
import QuizPage from "./QuizPage.js";

function App() {
  return (
    <div>
      <body>
        <div>
          <Navbar />
        </div>
        <QuizPage />
        <Footer />
      </body>
    </div>
  );
}

export default App;
